window.bookSummaryJSON = "<p>When a small group of humans are abducted from Earth, they find themselves thrust into a battle for the fate of the known universe. They are forced to put their trust in a mysterious artificial intelligence who has its own secret agenda.</p> <p>Banding together with beings from across the universe, the band of misfits must overcome an empire bent on the subjugation of Earth. Can the small band of allies overcome an ancient evil while unlocking the very secret of humanities origins?</p>"; 
